  padding-top: 50px;
  padding-bottom: 50px;
  //   flex-basis: 100vh;
  background-color: red;
`

export default function Main() {
  return (
    <StyledMain>
      <h1>Main</h1>
      <p>Main</p>
    </StyledMain>
  )
}
